import React, {Component} from 'react';
import foto from  '../imatges/fotoFiltres.jpg';
//import '../Cerca.css';

class Cerca extends Component{

    constructor(props){
        super();
    }

    render() {
      return (
        <div>
            <div className="card bg-dark text-white">
                <img src={foto} className="card-img" alt="portal d'una casa" />
                <div className="card-img-overlay">
                    <div className="card-text">
                        <div className="container">
                            <div className="row">

                                    <input type="date" id="start" name="start" placeholder="Data Inici" className="form-control col-3" />
                                    <input type="date" id="finish" name="finish" placeholder="Data Fi" className="form-control col-3" />
                                    <button className="btn btn-primary col-2"> Cerca </button>

                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
      );
    }
}

export default Cerca;
